import "./style.css";
import main_page from "./../../img/main_page.png";
import main_page2 from "./../../img/main_page2.png";
import main_page3 from"./../../img/main_page3.png";
const Slider = () => {
    return ( 

        <>
            <div className="slideshow">
                <div className="slade">
                <img src={main_page} alt="photo"></img>
                </div> 
                <div className="slade">
                <img src={main_page2} alt="photo2"></img>
                </div>
                <div className="slade">
                <img src={main_page3} alt="photo3"></img>
                </div>

                <div style="text-align:center">
                    <span class="dot" onclick="currentSlide(1)"></span>
                    <span class="dot" onclick="currentSlide(2)"></span>
                    <span class="dot" onclick="currentSlide(3)"></span>
                </div>
            </div>
        </>   
);
}
 
export default Slider;
